import React from 'react';
import { Row, Col, Image, Button } from 'react-bootstrap';
import styled from 'styled-components';
import './Projects.css'
import photosite from './assets/img/visualsbydandre.jpg';
import comparts from './assets/img/choosemyparts.png';
import cryptosite from './assets/img/cryptoupdates.png';
import Footer from '../footer/Footer';

const ProjectList = styled.div`
    padding-top: 7%;
    width: 100%;
    height: 100%;
`;

const projectRow = {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    width: "85%",
    paddingLeft: "15%"
};

const projectImage = {
    width: "100%",
    height: "auto"
};

export default function Test() {
    return (
        <ProjectList id="projects">     
            <h1 className="section-title">Projects</h1>
                <Row style={projectRow}>
                    <Col className="col-width"> 
                        <Image src={photosite} style={projectImage} className="project-iamge" />
                    </Col>
                    <Col className="col-width"> 
                        <p>Portfolio website for my photography and videos.</p>
                    </Col>
                </Row>
        </ProjectList>
    )
}
